/* eslint-disable react-hooks/rules-of-hooks */
import React, {
  useEffect,
  useLayoutEffect,
  useReducer,
  useRef,
  useState,
} from 'react';
import { useLocation, useNavigate } from 'react-router-dom';
import { observer, useObserver } from 'mobx-react';

import { useTranslation } from 'react-i18next';

import { styled } from '@mui/material/styles';

import classNames from 'classnames/bind';
import styles from '../../styles/App.module.scss';

function split() {
  return (
    <div className={styles.Allwrap}>
      <div className={styles.Innerwrap}>
        {/* 편집영역 */}
        <div className={styles.Contentswrap}>
          <div className={cx('topblock', 'detviewtab')}>
            <section className={cx('allpageArea', 'detpagevw')}>
              <div className={styles.inner}>
                {/* <div className={styles.notedate}>
                    <span className={cx('notedateTxt', 'ndtxtcst')}>{lastStrokeDate}</span>
                  </div> */}
                <div className={styles.pageContwrap}>
                  <div className={styles.notepagewrap}>
                    <ul className={styles.notepageItem}>
                      {/* {showMedia !== MediaEnum.VIDEO && ( */}
                      <MobilePageDetailMain
                        editMode={isEditMode}
                        onViewPageChanged={onActivePageChanged}
                        showHWR={userStore.showHWRLayer}
                        setDetailRef={setDetailRef}
                        isLassoMode={isLassoMode}
                        onSelectionPopupOpen={onSelectionPopupOpen}
                      />
                      {/* )} */}
                      {isLoading && (
                        <div
                          style={{
                            position: 'absolute',
                            top: 'calc(50vh - 40px)',
                            left: 'calc(50vw - 40px)',
                          }}
                        >
                          <CircleLoading />
                        </div>
                      )}
                      <DetailMedia
                        showMedia={showMedia}
                        mediaUrl={mediaUrl}
                        mediaPlaying={mediaPlaying}
                        clientViewProperty={
                          detailRef.current?.clientViewProperty
                        }
                        handlePlayMedia={handlePlayMedia}
                        handleCloseMedia={handleCloseMedia}
                        handleLoadingClose={handleLoadingClose}
                      />
                    </ul>
                  </div>
                </div>
              </div>
            </section>
          </div>
        </div>
      </div>
    </div>
  );
}

export default observer(split);
